import React from 'react';

function HomePage() {
  return (
    <div>
      <h2>Welcome to the Social Media Analysis Tool</h2>
      <p>
        Use the navigation bar above to enter data or perform queries
        based on the project requirements.
      </p>
      <p>
        This application allows you to manage projects, associate social
        media posts with them, record analysis results, and query the stored
        information.
      </p>
    </div>
  );
}

export default HomePage;
